import React from 'react';
import { Box, Typography, Container, Stack, Link as MuiLink } from '@mui/material';

const Footer = () => (
  <Box component="footer" sx={{ py: 4, bgcolor: '#e3f2fd', mt: 8, borderTop: '2px solid #bbdefb' }}>
    <Container maxWidth="lg">
      <Stack direction={{ xs: 'column', sm: 'row' }} justifyContent="space-between" alignItems="center" spacing={2}>
        <Typography variant="body2" color="text.secondary" sx={{ fontFamily: 'serif' }}>
          {new Date().getFullYear()} GoGetWell AI. All rights reserved.
        </Typography>
        <Stack direction="row" spacing={2}>
          <MuiLink href="/about" underline="hover" color="inherit" sx={{ fontFamily: 'serif', fontWeight: 'bold' }}>About</MuiLink>
          <MuiLink href="/contact" underline="hover" color="inherit" sx={{ fontFamily: 'serif', fontWeight: 'bold' }}>Contact</MuiLink>
        </Stack>
      </Stack>
    </Container>
  </Box>
);

export default Footer;
